import React from 'react';
import ReactDOM from 'react-dom';
import sdata from './Sdata';



ReactDOM.render(
    <>
    <Cards 
      imgsrc={sdata[0].imgsrc}
      title={sdata[0].title}
      sname={sdata[0].sname}
      links={sdata[0].links}
     />
    <Cards 
      imgsrc={sdata[1].imgsrc}
      title={sdata[1].title}
      sname={sdata[1].sname}
      links={sdata[1].links}
     />
    <Cards 
      imgsrc={sdata[2].imgsrc}
      title={sdata[2].title}
      sname={sdata[2].sname}
      links={sdata[2].links}
     />
    <Cards 
      imgsrc={sdata[3].imgsrc}
      title={sdata[3].title}
      sname={sdata[3].sname}
      links={sdata[3].links}
     />
    <Cards 
      imgsrc={sdata[4].imgsrc}
      title={sdata[4].title}
      sname={sdata[4].sname}
      links={sdata[4].links}
     />
    </>
    ,document.getElementById("root")
);
